import React, { useState } from 'react'
import styles from './changerWindow.module.css';
import index from './changerWindow.module.css';



export default function ChangerWindow({options, callback}) {

  return (
    <div className={'full_size ' + styles.changeWindow}>

        <div className={styles.div_optional}>
            {Object.keys(options).map((name, index) => (
                <button 
                    key={name}
                    onClick={(() => callback(options[name]))}
                >
                    {name}
                </button>
            ))}
        </div>

        <button>Back</button>

    </div>
  );
}
